import React, { useEffect, useState } from 'react';
import Fade from 'react-reveal/Fade';
import './FFNav.css';

export default function FFNav() {
  let today = new Date();

  const getTime = () => {
    let times = today.getHours() + ":" + today.getMinutes() + ":" + today.getSeconds();
    return times;
  }

  return (
    <Fade right duration={200}>
      <aside>
        <nav className="side-menu">
          <h2>Menu</h2>
          <h4>Item 1</h4>
          <h4>Item 2</h4>
        </nav>
        <div className="timer-container">
          <h3>Time</h3>
          <p>{setTimeout(getTime(), 1000)}</p>
        </div>
      </aside>
    </Fade>
  )
}
